import React from 'react'

function Gap() {
    return (
        <div>
            <h1>Gap</h1>
            <p> What is Gap brand?
Gap Inc. is a leading global retailer offering clothing, accessories, and personal care products for men, women, and children under the Old Navy, Gap, Banana Republic, Athleta, Intermix, Janie and Jack, and Hill City brands.</p>
        </div>
    )
}

export default Gap
